var mu sync.Mutex
var iconResources map[string]template.HTML

func loadIcons() {

	if iconResources != nil {
		return
	}

	mu.Lock()
	defer mu.Unlock()

	iconResources = make(map[string]template.HTML, 100)
	tmp := map[string]string{}
	err := json.Unmarshal([]byte(iconJSON), &tmp)
	if err != nil {
		panic(err)
	}

	for x, y := range tmp {
		//nolint:gosec
		iconResources[kebabToPascalCase(x)] = template.HTML(y) // unescaped
	}

}
func kebabToPascalCase(input string) string {
	words := strings.Split(input, "-")
	for i, word := range words {
		if len(word) > 0 {
			words[i] = strings.ToUpper(string(word[0])) + word[1:]
		}
	}
	return strings.Join(words, "")
}
func AppIcons(name string) template.HTML {

	loadIcons()

	res := iconResources[name]

	if res == "" {
		return template.HTML("<span></span>")
	}

	return res
}
